import React from "react";
import "./Donate.css";

const Success = () => {
  return (
    <>
    <div className="success-container">
      <div className="success-card">
        <h2>Donation Successful!</h2>
        <p>Thank you for your generous contribution.</p>
      </div>
    </div>
    </>
  );
};

export default Success;
